const ImageLinkForm = () => {
    return (
        <div>
            <p className='f3 tc'>
                {'This App will detect faces in your picture. Give it a try.'}
            </p>
            <div>
                <input type='text' />
                <button>Detect Face</button>
            </div>
        </div>
    );
}
export default ImageLinkForm;
